import React from 'react';

const Contact = () => {
  return (
    <div className="contact-container">
      <h2>Contact Us</h2>
      <div style={{ marginBottom: 24 }}>
        <b>DeliverDeli Restaurant</b><br />
        123 Main St, Downtown City, 12345<br />
        Phone: <a href="tel:+1234567890">+1 234 567 890</a><br />
        Email: <a href="mailto:support@deliverdeli.com">support@deliverdeli.com</a><br />
      </div>
      <div style={{ borderRadius: 12, overflow: 'hidden', boxShadow: '0 2px 8px rgba(34,34,59,0.10)', maxWidth: 600, margin: '0 auto' }}>
        <iframe
          title="DeliverDeli Location"
          src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d3153.019123456789!2d-122.4194154846816!3d37.7749297797597!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x8085809c5b5b5b5b%3A0x5b5b5b5b5b5b5b5b!2s123%20Main%20St%2C%20San%20Francisco%2C%20CA%2094105!5e0!3m2!1sen!2sus!4v1680000000000!5m2!1sen!2sus"
          width="100%"
          height="300"
          style={{ border: 0 }}
          allowFullScreen=""
          loading="lazy"
          referrerPolicy="no-referrer-when-downgrade"
        ></iframe>
      </div>
    </div>
  );
};

export default Contact;
